Contracts/FundMe.sol.content:
//  SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe{
    AggregatorV3Interface aggregatorV3Interface;

    function fund() public payable {
        require(msg.value >= 1e18, "Didn't send enough");
    }

    function getPrice() public {
        aggregatorV3Interface = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        (, int price,,,) = aggregatorV3Interface.latestRoundData();
    }

    // function widthdraw() public {

    // }
}

